import { Fragment } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import Navbar from "./component/layout/Navbar";

function App() {
  return (
    <>
      <Fragment>
        <Router>
          <Routes>
            <Route path='/' element={<Navbar />} />
            <Route path='/' element={<Navbar />} />

          </Routes>
        </Router>
      </Fragment>
    </>
  );
}

export default App;
